import React from 'react';
import Navbar1 from '../Navbar1';
import '../App.css';
function Account() {
	return (
		<div>
			<Navbar1 />
			<NavbarExplore />
			<section className="bg-light" style={{ minHeight: 700 }}>
				<Popular />
				<div className="divider" style={{ backgroundColor: '#ffc000' }}></div>
				<Hots />
				<div className="divider" style={{ backgroundColor: '#ffc000' }}></div>
				<New />
			</section>
		</div>
	);
}
export default Account;
